import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Select,
  MenuItem,
  InputLabel,
  FormControl,
  Button,
} from "@mui/material";

const CostTable = () => {
  const [data, setData] = useState([]);
  const [provider, setProvider] = useState("");
  const [sortField, setSortField] = useState("");
  const [sortOrder, setSortOrder] = useState("asc");

  useEffect(() => {
    fetchData();
  }, [provider, sortField, sortOrder]);

  const fetchData = async () => {
    try {
      let query = `http://localhost:3001/api/costs?`;

      if (provider) query += `provider=${provider}&`;
      if (sortField) query += `sort=${sortField}&order=${sortOrder}`;

      const response = await axios.get(query);
      setData(response.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>FinOps Dashboard</h2>

      {/* סינון לפי ספק */}
      <FormControl style={{ marginRight: "10px", minWidth: 120 }}>
        <InputLabel>Provider</InputLabel>
        <Select value={provider} onChange={(e) => setProvider(e.target.value)}>
          <MenuItem value="">All</MenuItem>
          <MenuItem value="AWS">AWS</MenuItem>
          <MenuItem value="GCP">GCP</MenuItem>
        </Select>
      </FormControl>

      {/* מיון לפי עלות */}
      <Button onClick={() => setSortField("cost")}>Sort by Cost</Button>

      {/* מיון לפי פרויקט */}
      <Button onClick={() => setSortField("project")}>Sort by Project</Button>

      {/* טבלת נתונים */}
      <TableContainer component={Paper} style={{ marginTop: "20px" }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>
                <strong>Provider Name</strong>
              </TableCell>
              <TableCell>
                <strong>Service Name</strong>
              </TableCell>
              <TableCell>
                <strong>Project Name</strong>
              </TableCell>
              <TableCell>
                <strong>Team Name</strong>
              </TableCell>
              <TableCell>
                <strong>Service Cost</strong>
              </TableCell>
              <TableCell>
                <strong>Date</strong>
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((row, index) => (
              <TableRow key={index}>
                <TableCell>{row.provider_name}</TableCell>
                <TableCell>{row.service_name}</TableCell>
                <TableCell>{row.project_name}</TableCell>
                <TableCell>{row.team_name}</TableCell>
                <TableCell>${row.cost}</TableCell>
                <TableCell>{new Date(row.date).toLocaleDateString()}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default CostTable;
